import React, { useState } from "react";

export default function Fetchv(){
    const [aaa, setAAA] = useState(Array);

    const kk = async (e) => {
        e.preventDefault();
        const res = await fetch('https://randomuser.me/api/')
        const data = await res.json()
        console.log(data)
        setAAA(aaa.fill(data));
    }
    return(
    <>
    <div>
        <button class="btn btn-primary btn-lg" onClick={kk}></button>
        <p>
            {aaa}
        </p>
    </div>
    </>)
}
